import React, {Component} from 'react';
import TodoItems from "./TodoItems";

class Todos extends Component {

    render() {
        console.log(this.props.todos)
        return this.props.todos.map((todo) => (
          <TodoItems todo = {todo} />
            )
        );
    }
}

export default Todos;
